// Dashboard.js
import React from "react";

const Dashboard = () => {
    return (
        <div className="p-6">
            <h1 className="text-2xl font-bold">Dashboard</h1>
            <p className="text-gray-600 mt-2">View your courses and progress here.</p>
        </div>
    );
};

export default Dashboard;
